import React, { useState, useEffect } from "react";
import { helpers } from "../../utils";
import styles from "./wine.module.css";

import axios from "axios";
const WineStats = () => {
  const [data, setData] = useState([]);

  // Define the grouping function
  function grouping(result, current) {
    debugger;
    const categary = current.Alcohol;
    if (!(categary in result)) {
      result[categary] = [];
    }
    result[categary].push(current);
    return result;
  }

  const results = {};

  async function fetchData() {
    debugger;
    try {
      const response = await axios.get("/data.json"); // Assuming the file is in the public folder

      console.log(response);
      // setData(response.data.data);
      let roleObj = {};
      const data = response.data.data.reduce(grouping, {});
      setData(data);
      console.log(Object.keys(data));
      console.log(Object.values(data));

      console.log(data);
      for (const key in data) {
        results[key] = {
          mean: helpers.calculateMean(data[key]),
          median: helpers.calculateMedian(data[key]),
          mode: helpers.calculateMode(data[key]),
        };
      }

      console.log(results);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  }

  useEffect(() => {
    fetchData();
  }, []);
  // Alcohol
  //   function grouping(key, obj) {
  //     if (!(key in obj)) {
  //       obj[key] = [];
  //     }
  //     obj.key.push(obj);
  //   }

  return (
    <div>
      <table>
        <tr>
          <th>Measure</th>

          {Object.keys(data).map((ele, index) => {
            return <th key={index}>{`Class ${ele}`}</th>;
          })}
        </tr>
        <tr>
          <td>Flavanoids mean</td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
        </tr>
        <tr>
          <td>Flavanoids Median</td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
        </tr>{" "}
        <tr>
          <td>Flavanoids Mode</td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
          <td>
            <p>Mean</p>
            <p>Median</p>
            <p>Mode</p>
          </td>
        </tr>
      </table>
    </div>
  );
};

export default WineStats;
